import React, { useState, useEffect } from 'react';
import './Home.css';

const Home = () => {
    const [table1Data, setTableData] = useState([
        { contrato: '001', cliente: 'Juan Pérez', sucursal: 'Sucursal A', identificador: '123456' },
        { contrato: '002', cliente: 'María García', sucursal: 'Sucursal B', identificador: '789012' }
    ]);
    const [table2Data, setTable1Data] = useState([]);
    useEffect(() => {
        // Simulación de llamada a una API para table1
        const fetchTable1Data = async () => {
            const response = await fetch('url_de_tu_api_para_table1');
            const data = await response.json();
            setTable1Data(data);
        };

        fetchTable1Data();
    }, []);

    return (
        <div className="home_container">
            <div className="home_header">
                <div className="table1_container">
                    <h1 className="title">CONTRATOS</h1>
                    <table>
                        <thead>
                            <tr>
                                <th>Contrato</th>
                                <th>Cliente</th>
                                <th>Sucursal</th>
                                <th>Identificador</th>
                            </tr>
                        </thead>
                        <tbody>
                            {table1Data.map((row, index) => (
                                <tr key={index}>
                                    <td>{row.contrato}</td>
                                    <td>{row.cliente}</td>
                                    <td>{row.sucursal}</td>
                                    <td>{row.identificador}</td>
                                </tr>
                            ))}
                        </tbody>
                    </table>
                </div>
                <div className="data1_container"></div>
                <div className="data2_container">
                    <div className="data2_colum"></div>
                    <div className="data2_colum"></div>
                    <div className="data2_colum"></div>
                </div>
            </div>
            <div className="table2_container">
                <h1 className="title">MODULOS</h1>
                <table>
                        <thead>
                            <tr>
                                <th>Código</th>
                                <th>Descripción</th>
                                <th>Origen</th>
                                <th>Factura</th>
                                <th>Valor</th>
                                <th>Estado</th>
                                <th>#Lic</th>
                                <th>Caduca</th>
                                <th>Motivo</th>
                                <th>Usuario</th>
                                <th>Paga</th>
                                <th>#TRansc</th>
                                <th>Cons.Real</th>


                            </tr>
                        </thead>
                        <tbody>
                            {table2Data.map((row, index) => (
                                <tr key={index}>
                                    <td>{row.codigo}</td>
                                    <td>{row.descripcion}</td>
                                    <td>{row.origen}</td>
                                    <td>{row.factura}</td>
                                    <td>{row.valor}</td>
                                    <td>
                                        <input
                                            type="checkbox"
                                            checked={row.estado}
                                            onChange={(e) => {
                                                const updatedTable1Data = [...table2Data];
                                                updatedTable1Data[index].estado = e.target.checked;
                                                setTable1Data(updatedTable1Data);
                                            }}
                                        />
                                    </td>
                                    <td>{row.lic}</td>
                                    <td>{row.caduca}</td>
                                    <td>{row.motivo}</td>
                                    <td>{row.usuario}</td>
                                </tr>
                            ))}
                        </tbody>
                    </table>

            </div>
        </div>
    );
};

export default Home;
